      \                     | -->\n<!-- ===================================================================================\
      \ -->\n<!-- Revolute-Revolute Manipulator -->\n<robot name=\"rrbot\">\n  <!--\
      \ Space btw top of beam and the each joint -->\n  <!-- ros_control plugin -->\n\
      \  <gazebo>\n    <plugin filename=\"libgazebo_ros_control.so\" name=\"gazebo_ros_control\"\
      >\n      <robotNamespace>/rrbot</robotNamespace>\n      <robotSimType>gazebo_ros_control/DefaultRobotHWSim</robotSimType>\n\
      \    </plugin>\n  </gazebo>\n  <!-- Link1 -->\n  <gazebo reference=\"link1\"\
      >\n    <material>Gazebo/Orange</material>\n  </gazebo>\n  <!-- Link2 -->\n \
      \ <gazebo reference=\"link2\">\n    <mu1>0.2</mu1>\n    <mu2>0.2</mu2>\n   \
      \ <material>Gazebo/Black</material>\n  </gazebo>\n  <!-- Link3 -->\n  <gazebo\
      \ reference=\"link3\">\n    <mu1>0.2</mu1>\n    <mu2>0.2</mu2>\n    <material>Gazebo/Orange</material>\n\
      \  </gazebo>\n  <!-- camera_link -->\n  <gazebo reference=\"camera_link\">\n\
      \    <mu1>0.2</mu1>\n    <mu2>0.2</mu2>\n    <material>Gazebo/Red</material>\n\
      \  </gazebo>\n  <!-- hokuyo -->\n  <gazebo reference=\"hokuyo_link\">\n    <sensor\
      \ name=\"head_hokuyo_sensor\" type=\"ray\">\n      <pose>0 0 0 0 0 0</pose>\n\
      \      <visualize>false</visualize>\n      <update_rate>40</update_rate>\n \
      \     <ray>\n        <scan>\n          <horizontal>\n            <samples>720</samples>\n\
      \            <resolution>1</resolution>\n            <min_angle>-1.570796</min_angle>\n\
      \            <max_angle>1.570796</max_angle>\n          </horizontal>\n    \
      \    </scan>\n        <range>\n          <min>0.10</min>\n          <max>30.0</max>\n\
      \          <resolution>0.01</resolution>\n        </range>\n        <noise>\n\
      \          <type>gaussian</type>\n          <!-- Noise parameters based on published\
      \ spec for Hokuyo laser\n               achieving \"+-30mm\" accuracy at range\
      \ < 10m.  A mean of 0.0m and\n               stddev of 0.01m will put 99.7%\
      \ of samples within 0.03m of the true\n               reading. -->\n       \
      \   <mean>0.0</mean>\n          <stddev>0.01</stddev>\n        </noise>\n  \
      \    </ray>\n      <plugin filename=\"libgazebo_ros_laser.so\" name=\"gazebo_ros_head_hokuyo_controller\"\
      >\n        <topicName>/rrbot/laser/scan</topicName>\n        <frameName>hokuyo_link</frameName>\n\
      \      </plugin>\n    </sensor>\n  </gazebo>\n  <!-- camera -->\n  <gazebo reference=\"\
      camera_link\">\n    <sensor name=\"camera1\" type=\"camera\">\n      <update_rate>30.0</update_rate>\n\
      \      <camera name=\"head\">\n        <horizontal_fov>1.3962634</horizontal_fov>\n\
      \        <image>\n          <width>800</width>\n          <height>800</height>\n\
      \          <format>R8G8B8</format>\n        </image>\n        <clip>\n     \
      \     <near>0.02</near>\n          <far>300</far>\n        </clip>\n       \
      \ <noise>\n          <type>gaussian</type>\n          <!-- Noise is sampled\
      \ independently per pixel on each frame.\n               That pixel's noise\
      \ value is added to each of its color\n               channels, which at that\
      \ point lie in the range [0,1]. -->\n          <mean>0.0</mean>\n          <stddev>0.007</stddev>\n\
      \        </noise>\n      </camera>\n      <plugin filename=\"libgazebo_ros_camera.so\"\
      \ name=\"camera_controller\">\n        <alwaysOn>true</alwaysOn>\n        <updateRate>0.0</updateRate>\n\
      \        <cameraName>rrbot/camera1</cameraName>\n        <imageTopicName>image_raw</imageTopicName>\n\
      \        <cameraInfoTopicName>camera_info</cameraInfoTopicName>\n        <frameName>camera_link_optical</frameName>\n\
      \        <!-- setting hackBaseline to anything but 0.0 will cause a misalignment\n\
      \            between the gazebo sensor image and the frame it is supposed to\n\
      \            be attached to -->\n        <hackBaseline>0.0</hackBaseline>\n\
      \        <distortionK1>0.0</distortionK1>\n        <distortionK2>0.0</distortionK2>\n\
      \        <distortionK3>0.0</distortionK3>\n        <distortionT1>0.0</distortionT1>\n\
      \        <distortionT2>0.0</distortionT2>\n        <CxPrime>0</CxPrime>\n  \
      \      <Cx>0.0</Cx>\n        <Cy>0.0</Cy>\n        <focalLength>0.0</focalLength>\n\
      \      </plugin>\n    </sensor>\n  </gazebo>\n  <material name=\"black\">\n\
      \    <color rgba=\"0.0 0.0 0.0 1.0\"/>\n  </material>\n  <material name=\"blue\"\
