      />\n    </inertial>\n  </link>\n  <joint name=\"joint2\" type=\"continuous\"\
      >\n    <parent link=\"link2\"/>\n    <child link=\"link3\"/>\n    <origin rpy=\"\
      0 0 0\" xyz=\"0 0.1 0.9\"/>\n    <axis xyz=\"0 1 0\"/>\n    <dynamics damping=\"\
      0.7\"/>\n  </joint>\n  <!-- Top Link -->\n  <link name=\"link3\">\n    <collision>\n\
      \      <origin rpy=\"0 0 0\" xyz=\"0 0 0.45\"/>\n      <geometry>\n        <box\
      \ size=\"0.1 0.1 1\"/>\n      </geometry>\n    </collision>\n    <visual>\n\
      \      <origin rpy=\"0 0 0\" xyz=\"0 0 0.45\"/>\n      <geometry>\n        <box\
      \ size=\"0.1 0.1 1\"/>\n      </geometry>\n      <material name=\"orange\"/>\n\
      \    </visual>\n    <inertial>\n      <origin rpy=\"0 0 0\" xyz=\"0 0 0.45\"\
      />\n      <mass value=\"25\"/>\n      <inertia ixx=\"2.10416666667\" ixy=\"\
      0.0\" ixz=\"0.0\" iyy=\"2.10416666667\" iyz=\"0.0\" izz=\"0.0416666666667\"\
      />\n    </inertial>\n  </link>\n  <joint name=\"hokuyo_joint\" type=\"fixed\"\
      >\n    <axis xyz=\"0 1 0\"/>\n    <origin rpy=\"0 0 0\" xyz=\"0 0 0.975\"/>\n\
      \    <parent link=\"link3\"/>\n    <child link=\"hokuyo_link\"/>\n  </joint>\n\
      \  <!-- Hokuyo Laser -->\n  <link name=\"hokuyo_link\">\n    <collision>\n \
