      0\" iyy=\"1e-6\" iyz=\"0\" izz=\"1e-6\"/>\n    </inertial>\n  </link>\n  <joint\
      \ name=\"camera_joint\" type=\"fixed\">\n    <axis xyz=\"0 1 0\"/>\n    <origin\
      \ rpy=\"0 0 0\" xyz=\"0.05 0 0.9\"/>\n    <parent link=\"link3\"/>\n    <child\
      \ link=\"camera_link\"/>\n  </joint>\n  <!-- Camera -->\n  <link name=\"camera_link\"\
      >\n    <collision>\n      <origin rpy=\"0 0 0\" xyz=\"0 0 0\"/>\n      <geometry>\n\
