      \    <visual>\n      <origin rpy=\"0 0 0\" xyz=\"0 0 0\"/>\n      <geometry>\n\
      \        <box size=\"0.05 0.05 0.05\"/>\n      </geometry>\n      <material\
      \ name=\"red\"/>\n    </visual>\n    <inertial>\n      <mass value=\"1e-5\"\
      />\n      <origin rpy=\"0 0 0\" xyz=\"0 0 0\"/>\n      <inertia ixx=\"1e-6\"\
